import React from 'react';
import { Card } from 'react-bootstrap';

const FavoritesPage = ({ favoriteAlbums }) => {
  return (
    <div>
      <h1>Favorites</h1>
      {favoriteAlbums.length > 0 ? (
        <ul>
          {favoriteAlbums.map(({ id, title }) => (
            <li key={id}>{title}</li>
          ))}
        </ul>
      ) : (
        <p>No favorite albums selected.</p>
      )}
    </div>
  );
};

export default FavoritesPage;
